import React, { useEffect } from 'react';
import { Calendar, MessageCircle, HelpCircle, Settings } from 'lucide-react';
import NavItem from './NavItem';
import SidebarSection from './SidebarSection';

const Sidebar = ({ isOpen, onClose }) => {
  // Prevent background scrolling when mobile menu is open
  useEffect(() => {
    if (isOpen) {
      document.body.style.overflow = 'hidden';
    } else {
      document.body.style.overflow = 'unset';
    }
    return () => {
      document.body.style.overflow = 'unset';
    };
  }, [isOpen]);

  return (
    <>
      {/* Overlay */}
      {isOpen && (
        <div 
          className="fixed inset-0 bg-black/50 z-20 lg:hidden" 
          onClick={onClose}
        />
      )}

      {/* Sidebar */}
      <div 
        className={`
          fixed top-0 left-0 bottom-0 z-30
          w-[280px] bg-white border-r border-gray-100
          lg:sticky lg:block
          ${isOpen ? 'translate-x-0' : '-translate-x-full lg:translate-x-0'}
          transition-transform duration-200 ease-in-out
        `}
      >
        {/* Logo */}
        <div className="h-16 flex items-center px-6 border-b border-gray-100">
          <h1 className="text-lg font-bold tracking-tight">
            <span className="text-cyan-500">Health</span>
            <span className="text-gray-700">care.</span>
          </h1>
        </div>

        {/* Scrollable content */}
        <div className="h-[calc(100vh-4rem)] overflow-y-auto">
          <nav className="p-4">
            <SidebarSection title="General">
              <NavItem 
                href="/dashboard" 
                icon={
                  <div className="grid grid-cols-2 gap-[2px] w-full h-full">
                    <div className="bg-blue-500 rounded-sm"></div>
                    <div className="bg-blue-500 rounded-sm"></div>
                    <div className="bg-blue-500 rounded-sm"></div>
                    <div className="bg-blue-500 rounded-sm"></div>
                  </div>
                }
                isActive
              >
                Dashboard
              </NavItem>

              <NavItem 
                href="/history" 
                icon={
                  <svg viewBox="0 0 20 20" fill="currentColor" className="w-5 h-5">
                    <path d="M3 4a1 1 0 011-1h12a1 1 0 110 2H4a1 1 0 01-1-1zm0 4a1 1 0 011-1h12a1 1 0 110 2H4a1 1 0 01-1-1zm0 4a1 1 0 011-1h12a1 1 0 110 2H4a1 1 0 01-1-1z" />
                  </svg>
                }
              >
                History
              </NavItem>

              <NavItem href="/calendar" icon={<Calendar className="w-5 h-5" />}>
                Calendar
              </NavItem>

              <NavItem 
                href="/appointments" 
                icon={
                  <svg viewBox="0 0 20 20" fill="currentColor" className="w-5 h-5">
                    <path d="M6 2a1 1 0 00-1 1v1H4a2 2 0 00-2 2v10a2 2 0 002 2h12a2 2 0 002-2V6a2 2 0 00-2-2h-1V3a1 1 0 10-2 0v1H7V3a1 1 0 00-1-1z" />
                  </svg>
                }
              >
                Appointments
              </NavItem>

              <NavItem 
                href="/stats" 
                icon={
                  <svg viewBox="0 0 20 20" fill="currentColor" className="w-5 h-5">
                    <path d="M2 11a1 1 0 011-1h2a1 1 0 011 1v5a1 1 0 01-1 1H3a1 1 0 01-1-1v-5zM8 7a1 1 0 011-1h2a1 1 0 011 1v9a1 1 0 01-1 1H9a1 1 0 01-1-1V7zM14 4a1 1 0 011-1h2a1 1 0 011 1v12a1 1 0 01-1 1h-2a1 1 0 01-1-1V4z" />
                  </svg>
                }
              >
                Statistics
              </NavItem>
            </SidebarSection>

            <SidebarSection title="Tools">
              <NavItem href="/chat" icon={<MessageCircle className="w-5 h-5" />}>
                Chat
              </NavItem>

              <NavItem href="/support" icon={<HelpCircle className="w-5 h-5" />}>
                Support
              </NavItem>
            </SidebarSection>
          </nav>

          {/* Settings at bottom */}
          <div className="absolute bottom-0 left-0 right-0 p-4 border-t border-gray-100 bg-white">
            <NavItem href="/settings" icon={<Settings className="w-5 h-5" />}>
              Settings
            </NavItem>
          </div>
        </div>
      </div>
    </>
  );
};

export default Sidebar;
